import React from 'react';

function Dashboard() {
  return (
    <div>
      <h3 className="section-title">Home Dashboard</h3>
      <div className="card">
        <p>Welcome! Use the navigation bar to access different modules.</p>
      </div>
    </div>
  );
}

export default Dashboard;
